	rv := make(map[string]sdkmath.Int)

	var errs []error
	int100k := sdkmath.NewInt(100_000_000_000_000) // 100k hash as nhash.
	for _, addr := range addrs100k {
		if _, known := rv[addr]; known {
			errs = append(errs, fmt.Errorf("address %q found again", addr))
		}
		rv[addr] = int100k
	}

	var ok bool
	for _, entry := range customAddrs {
		if _, known := rv[entry.addr]; known {
			errs = append(errs, fmt.Errorf("address %q found again", entry.addr))
		}

		nhash := hashToNhash(entry.hash)
		rv[entry.addr], ok = sdkmath.NewIntFromString(nhash)
		switch {
		case !ok:
			errs = append(errs, fmt.Errorf("could not convert %q to sdkmath.Int for %q", nhash, entry.addr))
		case !rv[entry.addr].IsPositive():
			errs = append(errs, fmt.Errorf("amount %q for %s is not positive", entry.hash, entry.addr))
		}
	}

	if len(errs) > 0 {
		panic(errors.Join(errs...))
	}

	return rv
